import styled, { keyframes } from "styled-components";
import pattern from "../../assets/images/pattern.png";
import debruy from "../../assets/images/debruy.png";
import label1 from "../../assets/images/cover-label-1.png";
import label2 from "../../assets/images/cover-label-2.png";
import shape from "../../assets/images/shape.png";

export const Container = styled.div`
  flex: 1;
  align-items: center;
  justify-content: center;
  align-items: center;
`;

export const Banner = styled.div`
  width: 100%;
  background: #ffbb29;
  display: flex;
  justify-content: center;
  position: relative;
`;

export const Pattern = styled.img.attrs({
  src: pattern,
})`
  width: 100%;
  height: 438px;
  object-fit: cover;
`;

export const Box = styled.div`
  width: 100%;
  height: 100%;
  position: absolute;
  bottom: 0;
  z-index: 1px;

  background: red;
`;

export const Debruy = styled.img.attrs({
  src: debruy,
})`
  position: absolute;
  bottom: 0;
  left: 100px;
  z-index: 2px;
  height: 250px;
  object-fit: contain;
`;

export const Label1 = styled.img.attrs({
  src: label1,
})`
  width: 80px;
  object-fit: contain;
  position: absolute;
  top: 130;
  left: 0;
`;

export const Label2 = styled.img.attrs({
  src: label2,
})`
  width: 110px;
  object-fit: contain;
  position: absolute;
`;

export const Shape = styled.img.attrs({
  src: shape,
})`
  width: 100%;
  object-fit: cover;
`;
